	@Test
	void shl_m_r8() {
		{ /* if (dst.size == MemoryOperandSize.QWORD) */
			// Skipping SHL_RM64_CL - Not supported by current bitness
		} /* else */ { /* if (dst.size == MemoryOperandSize.DWORD) */
			testAssembler(c -> c.shl(dword_ptr(0x0L).base(edx), cl), Instruction.create(Code.SHL_RM32_CL, new MemoryOperand(ICRegisters.edx, ICRegister.NONE, 1, 0x0L, 0, false, ICRegister.NONE), ICRegisters.cl));
		} /* else */ { /* if (dst.size == MemoryOperandSize.WORD) */
			testAssembler(c -> c.shl(word_ptr(0x0L).base(edx), cl), Instruction.create(Code.SHL_RM16_CL, new MemoryOperand(ICRegisters.edx, ICRegister.NONE, 1, 0x0L, 0, false, ICRegister.NONE), ICRegisters.cl));
		} /* else */ { /* if (dst.size == MemoryOperandSize.BYTE) */
			testAssembler(c -> c.shl(byte_ptr(0x0L).base(edx), cl), Instruction.create(Code.SHL_RM8_CL, new MemoryOperand(ICRegisters.edx, ICRegister.NONE, 1, 0x0L, 0, false, ICRegister.NONE), ICRegisters.cl));
		}
		{
			assertInvalid(() -> {
				testAssembler(c -> c.shl(zmmword_ptr(0x0L).base(edx), cl), Instruction.create(Code.SHL_RM8_CL, new MemoryOperand(ICRegisters.edx, ICRegister.NONE, 1, 0x0L, 0, false, ICRegister.NONE), ICRegisters.cl));
			});
		}
	}

