	@Test
	void shr_m_r8() {
		{ /* if (dst.size == MemoryOperandSize.QWORD) */
			// Skipping SHR_RM64_CL - Not supported by current bitness
		} /* else */ { /* if (dst.size == MemoryOperandSize.DWORD) */
			testAssembler(c -> c.shr(dword_ptr(0x0L).base(edx), cl), Instruction.create(Code.SHR_RM32_CL, new MemoryOperand(ICRegisters.edx, ICRegister.NONE, 1, 0x0L, 0, false, ICRegister.NONE), ICRegisters.cl));
		} /* else */ { /* if (dst.size == MemoryOperandSize.WORD) */
			testAssembler(c -> c.shr(word_ptr(0x0L).base(edx), cl), Instruction.create(Code.SHR_RM16_CL, new MemoryOperand(ICRegisters.edx, ICRegister.NONE, 1, 0x0L, 0, false, ICRegister.NONE), ICRegisters.cl));
		} /* else */ { /* if (dst.size == MemoryOperandSize.BYTE) */
			testAssembler(c -> c.shr(byte_ptr(0x0L).base(edx), cl), Instruction.create(Code.SHR_RM8_CL, new MemoryOperand(ICRegisters.edx, ICRegister.NONE, 1, 0x0L, 0, false, ICRegister.NONE), ICRegisters.cl));
		}
		{
			assertInvalid(() -> {
				testAssembler(c -> c.shr(zmmword_ptr(0x0L).base(edx), cl), Instruction.create(Code.SHR_RM8_CL, new MemoryOperand(ICRegisters.edx, ICRegister.NONE, 1, 0x0L, 0, false, ICRegister.NONE), ICRegisters.cl));
			});
		}
	}

