	@Test
	void shr_m_i() {
		{ /* if (imm == 1) */
			{ /* if (dst.size == MemoryOperandSize.QWORD) */
				// Skipping SHR_RM64_1 - Not supported by current bitness
			} /* else */ { /* if (dst.size == MemoryOperandSize.DWORD) */
				testAssembler(c -> c.shr(dword_ptr(0x0L).base(edx), 1), Instruction.create(Code.SHR_RM32_1, new MemoryOperand(ICRegisters.edx, ICRegister.NONE, 1, 0x0L, 0, false, ICRegister.NONE), 1));
			} /* else */ { /* if (dst.size == MemoryOperandSize.WORD) */
				testAssembler(c -> c.shr(word_ptr(0x0L).base(edx), 1), Instruction.create(Code.SHR_RM16_1, new MemoryOperand(ICRegisters.edx, ICRegister.NONE, 1, 0x0L, 0, false, ICRegister.NONE), 1));
			} /* else */ { /* if (dst.size == MemoryOperandSize.BYTE) */
				testAssembler(c -> c.shr(byte_ptr(0x0L).base(edx), 1), Instruction.create(Code.SHR_RM8_1, new MemoryOperand(ICRegisters.edx, ICRegister.NONE, 1, 0x0L, 0, false, ICRegister.NONE), 1));
			}
			{
				assertInvalid(() -> {
					testAssembler(c -> c.shr(zmmword_ptr(0x0L).base(edx), 1), Instruction.create(Code.SHR_RM8_1, new MemoryOperand(ICRegisters.edx, ICRegister.NONE, 1, 0x0L, 0, false, ICRegister.NONE), 1));
				});
			}
		} /* else */ { /* if (dst.size == MemoryOperandSize.QWORD) */
			// Skipping SHR_RM64_IMM8 - Not supported by current bitness
		} /* else */ { /* if (dst.size == MemoryOperandSize.DWORD) */
			testAssembler(c -> c.shr(dword_ptr(0x0L).base(edx), 2), Instruction.create(Code.SHR_RM32_IMM8, new MemoryOperand(ICRegisters.edx, ICRegister.NONE, 1, 0x0L, 0, false, ICRegister.NONE), 2));
		} /* else */ { /* if (dst.size == MemoryOperandSize.WORD) */
			testAssembler(c -> c.shr(word_ptr(0x0L).base(edx), 2), Instruction.create(Code.SHR_RM16_IMM8, new MemoryOperand(ICRegisters.edx, ICRegister.NONE, 1, 0x0L, 0, false, ICRegister.NONE), 2));
		} /* else */ { /* if (dst.size == MemoryOperandSize.BYTE) */
			testAssembler(c -> c.shr(byte_ptr(0x0L).base(edx), 2), Instruction.create(Code.SHR_RM8_IMM8, new MemoryOperand(ICRegisters.edx, ICRegister.NONE, 1, 0x0L, 0, false, ICRegister.NONE), 2));
		}
		{
			assertInvalid(() -> {
				testAssembler(c -> c.shr(zmmword_ptr(0x0L).base(edx), 2), Instruction.create(Code.SHR_RM8_IMM8, new MemoryOperand(ICRegisters.edx, ICRegister.NONE, 1, 0x0L, 0, false, ICRegister.NONE), 2));
			});
		}
	}

